import "./App.css";
import React, { Component } from "react";

class App extends Component {
	render() {
		const name = "Squish";
		const loading = false;

		if (loading) {
			return <h4>Loading...</h4>;
		}

		return (
			<div className="App">
				<h1>Hello {name}</h1>
			</div>
		);
	}
}

export default App;
